import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721RoyaltyUpgradeable.sol";
import "operator-filter-registry/src/upgradeable/DefaultOperatorFiltererUpgradeable.sol";
import "./Initialization/Initialization.sol";
import "./CantBeEvilCuriosUpgradeable.sol";
import "hardhat/console.sol";

contract Curios721 is
    OwnableUpgradeable,
    AccessControlUpgradeable,
    PausableUpgradeable,
    ERC721EnumerableUpgradeable,
    ERC721URIStorageUpgradeable,
    ERC721RoyaltyUpgradeable,
    DefaultOperatorFiltererUpgradeable,
    CantBeEvilCuriosUpgradeable
{
    bytes32 public constant URI_SETTER_ROLE = keccak256("URI_SETTER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");
    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    uint256 public maxSupply;
    bool public isPublicMint;
    uint256 public mintPrice;
    string public baseURI;

    constructor(Initialization.Initialization721 memory init) {
        initialize(init);
    }

    function initialize(Initialization.Initialization721 memory init)
        public
        initializer
    {
        __Ownable_init();
        __Pausable_init();

        __ERC721_init(init.name, init.symbol);
        _setDefaultRoyalty(init.royaltyRecipient, init.royaltyAmount);

        __DefaultOperatorFilterer_init();

        for (uint256 i = 0; i < init.admins.length; i++) {
            _grantRole(DEFAULT_ADMIN_ROLE, init.admins[i]);
        }

        for (uint256 i = 0; i < init.uriSetters.length; i++) {
            _grantRole(URI_SETTER_ROLE, init.uriSetters[i]);
        }

        for (uint256 i = 0; i < init.minters.length; i++) {
            _grantRole(MINTER_ROLE, init.minters[i]);
        }

        for (uint256 i = 0; i < init.burners.length; i++) {
            _grantRole(BURNER_ROLE, init.burners[i]);
        }

        for (uint256 i = 0; i < init.pausers.length; i++) {
            _grantRole(PAUSER_ROLE, init.pausers[i]);
        }

        __CantBeEvilCurios_init(init.licenseVersion);

        maxSupply = init.maxSupply;
        isPublicMint = init.isPublicMint;
        mintPrice = init.mintPrice;
    }

    function setBaseURI(string memory uri)
        external
        onlyRole(URI_SETTER_ROLE)
        whenNotPaused
    {
        baseURI = uri;
    }

    function _baseURI() internal view override returns (string memory) {
        return baseURI;
    }

    function publicMint(address receiver) external payable {
        console.log("I FINALLY RUN %o", isPublicMint);

        require(isPublicMint, "PM1");
        require(msg.value >= mintPrice, "PM2");
        _mintTo(receiver);
    }

    //may make a new role as this should probably only ever be allowed to be called succesfully
    //by one multi-sig or ledger.
    //at time of withdrawel, if curios fees are turned on, then send some % to curios, rest to wallet address.
    //Otherwise all to wallet address
    function withdrawPublicMintFunds(address wallet)
        external
        payable
        onlyRole(DEFAULT_ADMIN_ROLE)
        whenNotPaused
    {
        (bool sent, ) = wallet.call{value: address(this).balance}("");
        require(sent, "Failed to send Ether");
    }

    function mint() external {
        mintTo(msg.sender);
    }

    function mintTo(address addr) public onlyRole(MINTER_ROLE) {
        _mintTo(addr);
    }

    function _mintTo(address addr) internal whenNotPaused {
        if (maxSupply == 0) {
            _safeMint(addr, totalSupply(), "");
        } else {
            require(totalSupply() < maxSupply, "M1");
            _safeMint(addr, totalSupply(), "");
        }
    }

    //research burner role requirement
    function burn(uint256 tokenId)
        external
        onlyRole(BURNER_ROLE)
        whenNotPaused
    {
        _burn(tokenId);
    }

    function setApprovalForAll(address operator, bool approved)
        public
        override(ERC721Upgradeable, IERC721Upgradeable)
        onlyAllowedOperatorApproval(operator)
    {
        super.setApprovalForAll(operator, approved);
    }

    function approve(address operator, uint256 tokenId)
        public
        override(ERC721Upgradeable, IERC721Upgradeable)
        onlyAllowedOperatorApproval(operator)
    {
        super.approve(operator, tokenId);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    )
        public
        override(ERC721Upgradeable, IERC721Upgradeable)
        onlyAllowedOperator(from)
    {
        super.transferFrom(from, to, tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    )
        public
        override(ERC721Upgradeable, IERC721Upgradeable)
        onlyAllowedOperator(from)
    {
        super.safeTransferFrom(from, to, tokenId);
    }

    //Add forced royalties on all transfers. flat number like $1
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    )
        public
        override(ERC721Upgradeable, IERC721Upgradeable)
        onlyAllowedOperator(from)
    {
        super.safeTransferFrom(from, to, tokenId, data);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256, /* firstTokenId */
        uint256 batchSize
    ) internal override(ERC721Upgradeable, ERC721EnumerableUpgradeable) {
        super._beforeTokenTransfer(from, to, 0, batchSize);
    }

    function _burn(uint256 tokenId)
        internal
        override(
            ERC721Upgradeable,
            ERC721URIStorageUpgradeable,
            ERC721RoyaltyUpgradeable
        )
    {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
        returns (string memory)
    {
        return ERC721URIStorageUpgradeable.tokenURI(tokenId);
    }

    function pause() external onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(
            AccessControlUpgradeable,
            ERC721Upgradeable,
            ERC721EnumerableUpgradeable,
            ERC721RoyaltyUpgradeable,
            CantBeEvilCuriosUpgradeable
        )
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}
"
